import React from 'react'

function Project(props){
    const projectStyle = {
        width: 270,
        backgroundColor: 'pink',
        height: 270,
        margin: 40,
    }
    return (
        <a style={projectStyle}>
            <h3>title: {props.project.title}</h3>
            <a href={props.project.id}>{props.project.id}</a>
        </a>
    )
}
export default Project
